import '../style/Loginpage.css';
import logo1 from '../components/logo1.svg';

const Loginpage = () => {
  return (
    <div className="container"> 
      <div> 
        <img src={logo1} alt="logo1" className="logo" />
            <div className ="welcome">
            Log in 
            </div>  
      </div>
    </div>



  );
}

export default Loginpage;
